namespace PlinioJRM.Systems.Waves {
    public class WaveConfigurer {
        private WaveStrategy[] _strategies;
        private WaveRules[] _rules;

        public WaveConfigurer WithStrategies(WaveStrategy[] strategy) {
            _strategies = strategy;
            return this;
        }

        public WaveConfigurer WithRules(WaveRules[] rules) {
            _rules = rules;
            return this;
        }

        public void Configure(WaveFactory factory) {
            WaveStrategy strategy = SelectStrategy();
            WaveRules rule = SelectRule();
        }

        private WaveRules SelectRule() {
            throw new System.NotImplementedException();
        }

        private WaveStrategy SelectStrategy() {
            throw new System.NotImplementedException();
        }
    }
}

using PlinioJRM.Utils;
using UnityEngine;

namespace PlinioJRM.Systems.Waves {
    public class WaveManager : SingletonMonoBehaviour<WaveManager> {
        [SerializeField]
        private WaveStrategy[] _strategies;
        [SerializeField]
        private WaveRules[] _rules;
        
        public WaveStrategy[] GetStrategies() => _strategies;
        public WaveRules[] GetRules() => _rules;
        
        public int WaveNumber { get; set; }
    }
}
